tables.table_schema:
CREATE TABLE A/B_Test_Results (
    user_id INT,
    test_group VARCHAR(10),
    test_variation VARCHAR(10),
    conversion_event VARCHAR(50)
);

CREATE TABLE User_Preferences (
    user_id INT,
    preference_1 VARCHAR(20),
    preference_2 VARCHAR(20),
    preference_3 VARCHAR(20)
);

CREATE TABLE users(
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    join_date TIMESTAMP
);

CREATE TABLE test_details(
    test_id INT PRIMARY KEY,
    test_name VARCHAR(100),
    start_date DATE,
    end_date DATE
);

CREATE TABLE Users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL,
    created_at TIMESTAMP
);

CREATE TABLE Experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(50) NOT NULL,
    start_date DATE,
    end_date DATE
);

CREATE TABLE Groups (
    group_id INT PRIMARY KEY,
    group_name VARCHAR(50) NOT NULL
);
